import { Component } from 'react';
import './App.css';
import UserInput from './UserInput';
import UserOutput from './UserOutput';

class App extends Component{

  state = ({
    users:[
      {username:'Ouz', password:'1234'},
      {username:'Turan', password:'q1w2e3'}
    ]
  });

  onChangeNameEvent = (event) => {

    changeUserState({
      users:[
        {username:'Oguzhan', password:'whatTheFantasticPass'},
        {username: event.target.value, password:'coolPassword1234'}
      ]
    });
  }

  onChangePasswordEvent = (event) => {

    changeUserState({
      users:[
        {username:'Oguzhan', password:event.target.value},
        {username:'Turan', password:'coolPassword1234'}
      ]
    });
  }
render(){
  return (
    <div className="App">
      <header className="App-header">
        <p>Assignment-1</p>
      </header>
      <body>
        <UserInput 
          username={this.state.users[0].username}
          changeNameEvent={this.onChangeNameEvent.bind(this,"Deneme")} 
          changePasEvent={this.onChangePasswordEvent.bind(this,"adasda")}/>
        <UserOutput 
          username={this.state.users[0].username} 
          password={this.state.users[0].password}/>
        <UserOutput 
          username={this.state.users[1].username} 
          password={this.state.users[1].password}/>
      </body>
    </div>
  )
}
}

export default App;
